import React from 'react';
import { Route, Routes } from 'react-router-dom';

const Home = React.lazy(() => import('../pages/Home.jsx'));
const AllMovie = React.lazy(() => import('../components/AllMovie/AllMovie.jsx'));

const MovieDetail = React.lazy(() => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(import('../pages/detail/MovieDetail.jsx?cache=' + Math.random()));
    }, 3000);
  });
});

const Content = () => {
  return (
    <Routes>
      <Route path="/" element={<React.Suspense fallback={<h2>Loading</h2>}><Home /></React.Suspense>} />
      <Route path="/:category" element={<React.Suspense fallback={<h2>Loading</h2>}><AllMovie /></React.Suspense>} />
      <Route path="/:category/search/:kw" element={<React.Suspense fallback={<h2>Loading</h2>}><AllMovie /></React.Suspense>} />
      <React.Suspense fallback={<h2>Loading</h2>}>
        <Route path="/:category/:id" element={<MovieDetail />} />
      </React.Suspense>
    </Routes>
  );
};

export default Content;
